import React from 'react'
import {Route} from 'react-router-dom'

import CollectionsOverview from '../../components/collections-overview/collections-overview.component';
import Collections from '../collections/collections.component';


const ShopList = ({match})=>
{ 
console.log("Shop ",match.url)

    return(
    <div className="shop-list">
        <Route exact path={`${match.url}`} component={CollectionsOverview}/>
        <Route path='/shop/:collectionId' component={Collections}/>
    </div>
)}

export default ShopList
